import todo from "../models/todo";
import { Todo } from "./Todo";

import classes from "./Todos.module.css";

type Props = {
  items: todo[];
  onRemoveTodo: (id: string) => void;
};

export const Todos = ({ items, onRemoveTodo }: Props) => {
  return (
    <div>
      <ul className={classes.todos}>
        {items.map((item) => (
          <Todo id={item.id} text={item.text} onClickFunction={onRemoveTodo.bind(null, item.id)} />
        ))}
      </ul>
    </div>
  );
};
